// Categories.js
import React from 'react';

const categories = ["Sports", "Geography", "History", "Entertainment", "Art", "Science"];

function Categories() {
  return (
    <div>
      <h1>Categories</h1>
      {categories.map(category => (
        <button key={category}>{category}</button>
      ))}
    </div>
  );
}

export default Categories;
